#768-dimensional vector — that’s fixed by Google, so you can’t change it with a dimensions= parameter like in OpenAI’s text-embedding-3-large.

# Generate embeddings for a query
result = embedding.embed_query("What used to THE first CAPITAL OF INDIA in olden times")

print(result)


